   for (let i = 0; i &lt; n; i++) {\n                const xe = d['x_end'][i];\n                if (dateMs &gt;= xe &amp;&amp; xe &gt; best) {   // 'previous' = line that ENDED before this candle\n                    best = xe;\n                    yAt = d['m'][i] * dateMs + d['b'][i];\n                }\n            }\n            return yAt;\n        }\n\n        function pctDelta(y, yref) {\n            if (yref === null || !isFinite(yref) || yref === 0) return '\u2014';\n            const p = (y - yref) / yref * 100.0;\n            const sign = p &gt;= 0 ? '+' : '';\n            return sign + p.toFixed(2) + '%';\n        }\n\n        const yRes = yPrevAtDate(res, candleDate);\n        const ySup = yPrevAtDate(sup, candleDate);\n\n        // Calculate percentage from close price to previous resistance and support\n        const pctToRes = pctDelta(candleClose, yRes);\n        const pctToSup = pctDelta(candleClose, ySup);\n\n        div.text = `&lt;b&gt;Close: ${candleClose.toFixed(2)}&lt;/b&gt; &amp;nbsp; | &amp;nbsp; &lt;b&gt;\u0394 vs prev RES:&lt;/b&gt; ${pctToRes} &amp;nbsp; | &amp;nbsp; &lt;b&gt;\u0394 vs prev SUP:&lt;/b&gt; ${pctToSup}`;\n    "}}]]]},"width":1300,"x_range":{"type":"object","name":"Range1d","id":"p1016","attributes":{"start":-1,"end":607}},"y_range":{"type":"object","name":"Range1d","id":"p1017","attributes":{"start":243.27380737304688,"end":260.5361901855469}},"x_scale":{"type":"object","name":"LinearScale","id":"p1018"},"y_scale":{"type":"object","name":"LinearScale","id":"p1019"},"title":{"type":"object","name":"Title","id":"p1009","attributes":{"text":"RESISTANCE and SUPPORT trendlines for 111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111111
